import React from 'react';
import MoodSquare from '../partials/MoodSquare';

const Sidebar = () => {

    const test = [1, 2, 3];
    let bgColor = "gray";

    for (let i = 0; i < 365; i++) {
        return <MoodSquare />
    }

    return (
        <div className="App-sidebar">
            <div className="mood-grid">
                {test.map(num => {
                    return (<MoodSquare bgColor={bgColor}/>)
                })}
            </div>
        </div>
    )
}

export default Sidebar;
